message:
É assim que se controla os militares em uma ditadura:

Passo1: desvincular vencimentos do pessoal da ativa dos da reserva;

Passo 2: dar aumentos enormes para os da ativa (a partir daí, ficar na ativa será vital); 

Passo3: Limitar no tempo a permanência em cada posto e modificar processo de promoção, de modo a manter na ativa somente quem interessa. Os da reserva serão apenas mendigos a alimentar com esmolas.

